  societies of the actions being taken by the U.S. Fish and Wildlife Service to resolve
  concerns regarding habitat management practices at the Alamosa/Monte Vista National
  Wildlife Refuge Complex in Alamosa, Colorado, and to comply with (1) NEPA, (2) the
  compatibility requirements of the Refuge Administration Act for permitted uses at
